import React, { Component } from 'react'

class ClickCounter2 extends Component {

    render() {

        const { count, clickedTimes } = this.props
        return (


            <div>
                <button
                    onClick={this.clickedTimes} >Clicked {this.state.count} Times - {this.props.name}
                </button>
            </div>
        )
    }
}

export default ClickCounter2
